import React from 'react';
import styled from 'styled-components';

const EnrollTableTr = styled.tr`
    border-bottom: 1px solid #ccd;
    height: 30px;
    padding: 7px 3px;
`;

const EnrollTableTd = styled.td`
    &:nth-child(2n) {
        background-color: #ccf;
    }
`;

const EnrollListItem = () => {
    return (
        <EnrollTableTr>
            <EnrollTableTd></EnrollTableTd>
            <EnrollTableTd></EnrollTableTd>
            <EnrollTableTd></EnrollTableTd>
            <EnrollTableTd></EnrollTableTd>
        </EnrollTableTr>
    );
};

export default EnrollListItem;
